INSERT INTO `gb_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(3, 1, 'Privacy Policy', '&lt;h1 style=&quot;mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;line-height:normal;mso-outline-level:2&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:18.0pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/b&gt;&lt;/h1&gt;&lt;h1 style=&quot;mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;line-height:normal;mso-outline-level:2&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:18.0pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;Privacy Policy&lt;/span&gt;&lt;/b&gt;&lt;/h1&gt;&lt;h1 style=&quot;mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;line-height:normal;mso-outline-level:2&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:18.0pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/b&gt;&lt;/h1&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.6;&quot;&gt;&lt;span style=&quot;font-size:8.5pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;Protecting your privacy is veryimportant to us. We have accordingly developed this Privacy Policy to protectyour personal information and keep it confidential. By accessing the servicesprovided by the Site you agree to the collection and use of your data byGharBaitho in the manner provided in this Privacy Policy. We try to ensureeverything we reasonably can to protect your rights of privacy on systems andthe Website controlled by us, but we are not liable for any unauthorized orunlawful disclosures of your personal and confidential information made bythird parties who are not subject to our control.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.6;&quot;&gt;&lt;span style=&quot;font-size:8.5pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 1.6;&quot;&gt;&lt;span style=&quot;font-size:8.5pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;&lt;o:p&gt;&lt;br&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;h2 style=&quot;mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;line-height:normal;mso-outline-level:2&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:18.0pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot;&gt;Collection of Information&lt;/span&gt;&lt;/b&gt;&lt;/h2&gt;&lt;h2 style=&quot;mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;line-height:normal;mso-outline-level:2&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:18.0pt;font-family:&amp;quot;Verdana&amp;quot;,&amp;quot;sans-serif&amp;quot;;mso-fareast-font-family:&amp;quot;Times New Roman&amp;quot;;mso-bidi-font-family:&amp;quot;Times New Roman&amp;quot;;color:black;mso-fareast-language:EN-GB&quot