INSERT INTO `gb_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(4, 1, 'About Us', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;	&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;center&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;img src=&quot;http://gharbaitho.com/DDN07/image/Image_Files/Logo/GB-Favicon.png&quot; style=&quot;float: none; margin: 20px;&quot;&gt;&lt;/span&gt;&lt;/center&gt;&lt;p&gt;&lt;/p&gt;&lt;p style=&quot;font-size:20px;line-height:22px;text-align: justify;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-size:20px;line-height:22px;text-align: justify;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;GharBaitho.com&lt;/span&gt; is the newest and most advanced way to shop for groceries and other daily household needs online. We aim to bridge the distance between an arbitrary household and the supermarket. Evolved from the concept of a hassle free shopping technique that enables you to free up time from your busy life. &amp;nbsp;We encourage the expenditure of this saved time on the more important things in life. We are dedicated to 100% customer satisfaction through our incredibly intuitive shopping experience all the way from browsing through products, ordering and finally getting it delivered right at your doorstep. So sit back and take advantage of this remarkable shopping revolution and save your day, literally.&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;Happy Grocery Shopping at GharBaitho.com!&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;/p&gt;', 'About-us', '', ''),
(6, 1, 'Delivery Information', '&lt;p&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;	&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;/p&gt;\r\n\r\n&lt;center&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;img src=&quot;http://gharbaitho.com/DDN07/image/Image_Files/Logo/GB-Favicon.png&quot; style=&quot;float: none; margin: 20px;&quot;&gt;&lt;/span&gt;&lt;/center&gt;&lt;p&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size:20px;line-height:22px;text-align: justify;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;DELIVERY INFORMATION&lt;br&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size:20px;line-height:22px;text-align: justify;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;/span&gt; All orders received till 04:00pm any day will be delivered on the same day by 08:00pm. Orders received after 04:00pm will be delivered on the next day between 04:00pm and 08:00pm. &lt;/p&gt;&lt;p style=&quot;font-size:20px;line-height:22px;text-align: justify;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-size:20px;line-height:22px;text-align: justify;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;/span&gt; Free Shipping is only applicable for orders worth 1000 or more. A Flat Shipping Rate of 50 is applicable for all orders below 1000.&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;Happy Grocery Shopping at GharBaitho.com!&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-weight: bold;font-size:20px;line-height:22px;&quot;&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;/p&gt;', 'Delivery-Information', '', ''),
(7, 1, 'Independence Week Sale - Additional 15 Percent Discount', '&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;Independence Week Sale - Additional 15 Percent Discount&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;So What''s the DEAL?&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;&lt;br&gt;1. Flat Shipping Charges of &lt;/span&gt;&lt;/span&gt;50 Waived Off during the Offer Period.&lt;/p&gt;&lt;p&gt;2. Additional Discount of 15% Across the entire range of GharBaitho Products.&lt;/p&gt;&lt;p&gt;3. FREE Home Delivery anywhere in Dehradun during the Offer Period.&lt;/p&gt;&lt;p&gt;4. Minimum Order Limit of 1000 Waived Off during the Offer Period.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;Terms and Conditions:&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;1. Coupon Code &quot;15AUG&quot; needs to be applied on Shopping Cart page. If Coupon Code is not applied, the Offer cannot be availed.&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;2. Offer is not applicable for Bulk Orders*.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;3. Limited Period Offer. Valid Till 16th August, 2015 only.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;span style=&quot;font-weight: normal;&quot;&gt;4. This Offer cannot be combined with any other offer(s).&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;5. GharBaitho reserves the right to amend or withdraw any/all offers without any prior notice.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;*Bulk Orders are defined as orders exceeding the amount of 10,000. Offer valid for one order per customer per day residing at a single address, not exceeding the amount of&amp;nbsp;10,000.&lt;/p&gt;', 'Independence-Week-Sale', 'Independence-Week-Sale-on-GharBaitho.com', 'Independe, Day, GharBaitho, Ghar, Baitho, Sale');
