(12, 'journal2_popup', '{"module_name":"New module","close_button":"0","padding":"15","title":{"value":{"1":""}},"title_font":{"value":{"font_type":"none","font_size":"13px","font_family":"Helvetica, Arial, sans-serif","font_name":"","font_weight":"normal","font_style":"normal","letter_spacing":"","text_transform":"none"}},"title_bg_color":"","title_height":"0","newsletter":"0","newsletter_bg_color":"","newsletter_height":80,"newsletter_id":"","footer_height":"0","footer_bg_color":"","type":"text","text":[null,"<script language=\\"javascript\\">\\/\\/ <![CDATA[\\n$(''#welcomeFormDesktop'').submit(function (event1) {\\n event1.preventDefault();\\n });\\n$(''#welcomeFormMobile'').submit(function (event2) {\\n event2.preventDefault();\\n });\\n$(''#welcomeFormTablet'').submit(function (event3) {\\n event3.preventDefault();\\n }); \\n\\n\\nfunction checkDesktop()\\n{\\n	if(userFormDesktop.nameDesktop.value.replace(\\/^s+1s+$\\/g,\\"\\")==\\"\\")\\n	{\\n alert(\\"Please enter Name !\\");\\n userFormDesktop.nameDesktop.focus();\\n return(false);\\n	}\\n	if(userFormDesktop.emailDesktop.value.replace(\\/^s+1s+$\\/g,\\"\\")==\\"\\")\\n	{\\n alert(\\"Please enter your email id !\\");\\n userFormDesktop.emailDesktop.focus();\\n return(false);\\n	}\\n	var xDesktop=document.forms[\\"userFormDesktop\\"][\\"emailDesktop\\"].value;\\n	var atposDesktop=xDesktop.indexOf(\\"@\\");\\n	var dotposDesktop=xDesktop.lastIndexOf(\\".\\");\\n	if (atposDesktop<1 || dotposDesktop<atposDesktop+2 || dotposDesktop+2>=xDesktop.length)\\n {\\n alert(\\"Not a valid e-mail address\\");\\n userFormDesktop.emailDesktop.focus();\\n return false;\\n }	\\n}\\nfunction checkMobile()\\n{\\n	if(userFormMobile.nameMobile.value.replace(\\/^s+1s+$\\/g,\\"\\")==\\"\\")\\n	{\\n alert(\\"Please enter Name !\\");\\n userFormMobile.nameMobile.focus();\\n return(false);\\n	}\\n	if(userFormMobile.emailMobile.value.replace(\\/^s+1s+$\\/g,\\"\\")==\\"\\")\\n	{\\n alert(\\"Please enter your email id !\\");\\n userFormMobile.emailMobile.focus();\\n return(false);\\n	}\\n	var xMobile=document.forms[\\"userFormMobile\\"][\\"emailMobile\\"].value;\\n	var atposMobile=xMobile.indexOf(\\"@\\");\\n	var dotposMobile=xMobile.lastIndexOf(\\".\\");\\n	if (atposMobile<1 || dotposMobile<atposMobile+2 || dotposMobile+2>=xMobile.length)\\n {\\n alert(\\"Not a valid e-mail address\\");\\n userFormMobile.emailMobile.focus();\\n return false;\\n }	\\n}\\nfunction checkTablet()\\n{\\n	if(userFormTablet.nameTablet.value.replace(\\/^s+1s+$\\/g,\\"\\")==\\"\\")\\n	{\\n alert(\\"Please enter Name !\\");\\n userFormTablet.nameTablet.focus();\\n return(false);\\n	}\\n	if(userFormTablet.emailTablet.value.replace(\\/^s+1s+$\\/g,\\"\\")==\\"\\")\\n	{\\n alert(\\"Please enter your email id !\\");\\n userFormTablet.emailTablet.focus();\\n return(false);\\n	}\\n	var xTablet=document.forms[\\"userFormTablet\\"][\\"emailTablet\\"].value;\\n	var atposTablet=xTablet.indexOf(\\"@\\");\\n	var dotposTablet=xTablet.lastIndexOf(\\".\\");\\n	if (atposTablet<1 || dotposTablet<atposTablet+2 || dotposTablet+2>=xTablet.length)\\n {\\n alert(\\"Not a valid e-mail address\\");\\n userFormTablet.emailTablet.focus();\\n return false;\\n }	\\n}\\nfunction isNumberkey(evt)\\n{\\nvar charcode=(evt.which) ? evt.which : event.keycode;\\nif(charcode>31 && (charcode<48||charcode>57))\\nreturn false;\\nelse if(charcode == 13)\\npinValidateDesktop();\\nreturn true;\\n}\\nfunction isCharkey(evt)\\n{\\nvar charcode=(evt.which) ? evt.which : event.keycode;\\nif(charcode!=32 && (charcode<65||charcode>90) && (charcode<97||charcode>122) && (charcode!=46))\\nreturn false;\\nreturn true;\\n}\\nfunction pinValidateDesktop() {\\nvar str = document.getElementById(''pinCodeDesktop'').value;\\n if (str == \\"\\") {\\n return;\\n } else { \\n if (window.XMLHttpRequest) {\\n \\/\\/ code for IE7+, Firefox, Chrome, Opera, Safari\\n xmlhttp = new XMLHttpRequest();\\n } else {\\n \\/\\/ code for IE6, IE5\\n xmlhttp = new ActiveXObject(\\"Microsoft.XMLHTTP\\");\\n }\\n xmlhttp.onreadystatechange = function() {\\n if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {\\n document.getElementById(\\"changeDivDesktop\\").innerHTML = xmlhttp.responseText;\\n }\\n }\\n xmlhttp.open(\\"GET\\",\\"getShopDesktop.php?q=\\"+str,true);\\n xmlhttp.send();\\n }\\n}\\nfunction pinValidateMobile() {\\nvar str = document.getElementById(''pinCodeMobile'').value;\\n if (str == \\"\\") {\\n return;\\n } else { \\n if (window.XMLHttpRequest) {\\n \\/\\/ code for IE7+, Firefox, Chrome, Opera, Safari\\n xmlhttp = new XMLHttpRequest();\\n } else {\\n \\/\\/ code for IE6, IE5\\n xmlhttp = new ActiveXObject(\\"Microsoft.XMLHTTP\\");\\n }\\n xmlhttp.onreadystatechange = function() {\\n if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {\\n document.getElementById(\\"changeDivMobile\\").innerHTML = xmlhttp.responseText;\\n }\\n }\\n xmlhttp.open(\\"GET\\",\\"getShopMobile.php?q=\\"+str,true);\\n xmlhttp.send();\\n }\\n}\\nfunction pinValidateTablet() {\\nvar str = document.getElementById(''pinCodeTablet'').value;\\n if (str == \\"\\") {\\n return;\\n } else { \\n if (window.XMLHttpRequest) {\\n \\/\\/ code for IE7+, Firefox, Chrome, Opera, Safari\\n xmlhttp = new XMLHttpRequest();\\n } else {\\n \\/\\/ code for IE6, IE5\\n xmlhttp = new ActiveXObject(\\"Microsoft.XMLHTTP\\");\\n }\\n xmlhttp.onreadystatechange = function() {\\n if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {\\n document.getElementById(\\"changeDivTablet\\").innerHTML = xmlhttp.responseText;\\n }\\n }\\n xmlhttp.open(\\"GET\\",\\"getShopTablet.php?q=\\"+str,true);\\n xmlhttp.send();\\n }\\n}\\n\\/\\/ ]]><\\/script>\\n<center><img alt=\\"\\" height=\\"140\\" src=\\"http:\\/\\/gharbaitho.com\\/image\\/GB-Mobile-Icon.png\\" width=\\"140\\" \\/>\\n<h1>Welcome, to GharBaitho!<\\/h1>\\n\\n<h3>The Finest E-Grocery Experience<\\/h3>\\n\\n<p>&nbsp;<\\/p>\\n\\n<hr \\/><\\/center>\\n\\n<p>&nbsp;<\\/p>\\n\\n<p><strong style=\\"line-height: 1.2;\\">Please enter your 6-digit Area (or