(1, 'Local copy OCMOD by iSenseLabs', 'isensealabs_quickfix_ocmod', 'iSenseLabs', '1.1.1', 'http://isenselabs.com', '<modification>\r\n    <name>Local copy OCMOD by iSenseLabs</name>\r\n	<version>1.1.1</version>\r\n	<link>http://isenselabs.com</link>\r\n	<author>iSenseLabs</author>\r\n	<code>isensealabs_quickfix_ocmod</code>\r\n\r\n	<file path="admin/controller/extension/installer.php">\r\n		<operation>\r\n			<search ><![CDATA[''url''  => str_replace(''&amp;'', ''&'', $this->url->link(''extension/installer/ftp'', ''token='' . $this->session->data[''token''], ''SSL'')),]]></search>\r\n			<add position="replace"><![CDATA[''url''  => str_replace(''&amp;'', ''&'', $this->url->link(''extension/installer/localcopy'', ''token='' . $this->session->data[''token''], ''SSL'')),]]></add>\r\n		</operation>\r\n\r\n		<operation>\r\n			<search><![CDATA[public function unzip() {]]></search>\r\n			<add position="before"><![CDATA[			\r\n	public function localcopy() {\r\n		$this->load->language(''extension/installer'');\r\n\r\n		$json = array();\r\n\r\n		if (!$this->user->hasPermission(''modify'', ''extension/installer'')) {\r\n			$json[''error''] = $this->language->get(''error_permission'');\r\n		}\r\n\r\n        if (VERSION == ''2.0.0.0'') {\r\n            $directory = DIR_DOWNLOAD  . str_replace(array(''../'', ''..\\\\'', ''..''), '''', $this->request->post[''path'']) . ''/upload/'';\r\n        } else {\r\n            $directory = DIR_UPLOAD  . str_replace(array(''../'', ''..\\\\'', ''..''), '''', $this->request->post[''path'']) . ''/upload/'';\r\n        }\r\n\r\n		if (!is_dir($directory)) {\r\n			$json[''error''] = $this->language->get(''error_directory'');\r\n		}\r\n\r\n		if (!$json) {\r\n			// Get a list of files ready to upload\r\n			$files = array();\r\n\r\n			$path = array($directory . ''*'');\r\n\r\n			while (count($path) != 0) {\r\n				$next = array_shift($path);\r\n\r\n				foreach (glob($next) as $file) {\r\n					if (is_dir($file)) {\r\n						$path[] = $file . ''/*'';\r\n					}\r\n\r\n					$files[] = $file;\r\n				}\r\n			}\r\n\r\n			$root = dirname(DIR_APPLICATION).''/'';\r\n\r\n			foreach ($files as $file) {\r\n				// Upload everything in the upload directory\r\n				$destination = $root.substr($file, strlen($directory));\r\n\r\n				if (is_dir($file)) {\r\n					$list = glob(rtrim($destination, ''/'').''/*'');\r\n\r\n					if (!file_exists($destination)) {\r\n						if (!mkdir($destination)) {\r\n							$json[''error''] = sprintf($this->language->get(''error_ftp_directory''), $destination);\r\n						}\r\n					}\r\n				}\r\n\r\n				if (is_file($file)) {\r\n					if (!copy($file, $destination)) {\r\n						$json[''error''] = sprintf($this->language->get(''error_ftp_file''), $file);\r\n					}\r\n				}\r\n			}\r\n		}\r\n\r\n		$this->response->addHeader(''Content-Type: application/json'');\r\n		$this->response->setOutput(json_encode($json));\r\n	}]]></add>\r\n		</operation>\r\n	</file>	\r\n</modification>', 1, '2015-07-14 18:54:27'),
(4, 'Export/Import Tool for OpenCart 2.0.x', 'Export/Import Tool for OpenCart 2.0.x', 'mhccorp.com', '2.0.x-2.20', '', '<modification>\n	<name>Export/Import Tool for OpenCart 2.0.x</name>\n	<code>Export/Import Tool for OpenCart 2.0.x</code>\n	<version>2.0.x-2.20</version>\n	<author>mhccorp.com</author>\n	<file path="admin/controller/common/menu.php">\n		<operation>\n			<search><![CDATA[$data[''text_backup''] = $this->language->get(''text_backup'');]]></search>\n			<add position="after"><![CDATA[\n		$data[''text_export_import''] = $this->language->get(''text_export_import'');\n			]]></add>\n		</operation>\n		<operation>\n			<search><![CDATA[$data[''backup''] = $this->url->link(''tool/backup'', ''token='' . $this->session->data[''token''], ''SSL'');]]></search>\n			<add position="after"><![CDATA[\n		$data[''export_import''] = $this->url->link(''tool/export_import'', ''token='' . $this->session->data[''token''], ''SSL'');\n			]]></add>\n		</operation>\n	</file>\n	<file path="admin/language/*/common/menu.php">\n		<operation>\n			<search><![CDATA[$_[''text_backup'']                      = ''Backup / Restore'';]]></search>\n			<add position="after"><![CDATA[\n$_[''text_export_import'']               = ''Export / Import'';\n			]]></add>\n		</operation>\n	</file>\n	<file path="admin/view/template/common/menu.tpl">\n		<operation>\n			<search><![CDATA[<li><a href="<?php echo $backup; ?>"><?php echo $text_backup; ?></a></li>]]></search>\n			<add position="after"><![CDATA[\n      <li><a href="<?php echo $export_import; ?>"><?php echo $text_export_import; ?></a></li>\n			]]></add>\n		</operation>\n	</file>\n</modification>\n', 1, '2015-07-24 19:35:41'),
(3, 'invoice_prod_image_logo_ocmod', 'invoice_prod_image_logo_ocmod', 'ocextensions.co.uk for cancer research', '1.2 invoice_prod_image_logo_ocmo', 'mailto:support@ocextensions.co.uk', '<?xml version="1.0" encoding="utf-8"?>\n<modification>  \n    <name>invoice_prod_image_logo_ocmod</name>\n    <id>invoice_prod_image_logo_ocmod</id>\n    <version>1.2 invoice_prod_image_logo_ocmod</version>\n    <author>ocextensions.co.uk for cancer research</author>\n    <link>mailto:support@ocextensions.co.uk</link>\n    <code>invoice_prod_image_logo_ocmod</code>\n    <file path="admin/model/sale/order.php"> \n        <operation>\n            <search index="0"><![CDATA[return $query->row[''total''];]]></search>\n            <add position="after" offset="2"><![CDATA[    public function getProductImage($product_id) {\n		$query = $this->db->query("SELECT image FROM " . DB_PREFIX . "product WHERE product_id = ''" . (int)$product_id . "''");\n		return $query->row;\n	}]]></add>\n        </operation>\n    </file>\n    <file path="admin/controller/sale/order.php">\n        <operation>\n            <search><![CDATA[$store_fax = $store_info[''config_fax''];]]></search>\n            <add position="after"><![CDATA[					$store_logo = $store_info[''config_logo''];]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[=> $order_info[''store_name''],]]></search>\n            <add position="after"><![CDATA[					''logo''              => HTTP_CATALOG . ''image/'' .$store_info[''config_logo''],]]></add>\n        </operation>\n        <operation> \n            <search><![CDATA[$option_data = array();]]></search>\n            <add position="after"><![CDATA[                     $product[''img''] = $this->model_sale_order->getProductImage($product[''product_id'']);]]></add>\n        </operation>\n        <operation>  \n            <search><![CDATA[$product_data[] = array(]]></search>\n            <add position="before"><![CDATA[                             $this->load->model(''tool/image'');]]></add>\n        </operation>\n        <operation>   \n            <search><![CDATA[$product_data[] = array(]]></search>\n            <add position="after"><![CDATA[                        ''image''    => $this->model_tool_image->resize($product[''img''][''image''], $this->config->get(''config_image_cart_width''), $this->config->get(''config_image_cart_height'')),\n                        ''width''    => $this->config->get(''config_image_cart_width''),]]></add>\n        </operation>\n    </file>\n    <file path="admin/view/template/sale/order_shipping.tpl">\n        <operation>\n            <search><![CDATA[<div style="page-break-after: always;">]]></search>\n            <add position="after"><![CDATA[     <img src=<?php echo $order[''logo'']; ?> />]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[<td><b><?php echo $column_product; ?></b></td>]]></search>\n            <add position="replace"><![CDATA[     <td colspan="2"><b><?php echo $column_product; ?></b></td>]]></add>\n        </operation>\n        <operation>  \n            <search><![CDATA[<td><?php echo $product[''name'']; ?>]]></search>\n            <add position="before"><![CDATA[        <td style="width:<?php echo $product[''width''] ?>px"><img src="<?php echo $product[''image''] ?>"></td>]]></add>\n        </operation>\n    </file>\n    <file path="admin/view/template/sale/order_invoice.tpl">\n        <operation>\n            <search><![CDATA[<div style="page-break-after: always;">]]></search>\n            <add position="after"><![CDATA[     <img src=<?php echo $order[''logo'']; ?> />]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[<td><b><?php echo $column_product; ?></b></td>]]></search>\n            <add position="replace"><![CDATA[     <td colspan="2"><b><?php echo $column_product; ?></b></td>]]></add>\n        </operation>\n        <operation>  \n            <search><![CDATA[<td><?php echo $product[''name'']; ?>]]></search>\n            <add position="before"><![CDATA[        <td style="width:<?php echo $product[''width''] ?>px"><img src="<?php echo $product[''image''] ?>"></td>]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[colspan="4"]]></search>\n            <add position="replace"><![CDATA[colspan="5"]]></add>\n        </operation>\n    </file>          \n</modification>', 1, '2015-07-15 11:21:51');
